      content:
        // eslint-disable-next-line no-template-curly-in-string
        'async function startWorkflow() {\r\n    const rpa = new rpaLib.Rpa();\r\n    await rpa.connect($wsEndpoint);\r\n    // code here\r\n    try {\r\n\r\n        await rpa.gotoUrl(`https://www.facebook.com/${PAGE_ID}`);\r\n\r\n        await delay(getRandomNumber(2000, 3000));\r\n        let getUrl = (await rpa.getUrl()).toString();\r\n\r\n        if (getUrl.includes("facebook.com/login")) {\r\n            await updateOrCreateResource("facebook", { status: "not_logged_in" });\r\n            await rpa.control.close();\r\n            return;\r\n        } else if (getUrl.includes(\'facebook.com/checkpoint\')) {\r\n            await updateOrCreateResource("facebook", { status: "checkpoint" });\r\n            await rpa.control.close();\r\n            return;\r\n        } else if (await rpa.checkExistElement(\'//div[@aria-label="Accessible login button"]\')) {\r\n            await updateOrCreateResource("facebook", { status: "not_logged_in" });\r\n            await rpa.control.close();\r\n            return;\r\n        } else {\r\n            await updateOrCreateResource("facebook", { status: "live" });\r\n        }\r\n\r\n        let cursor = "";\r\n        let is_final = false;\r\n        let min_time = TIME_DELAY.min * 1000;\r\n        let max_time = TIME_DELAY.max * 1000;\r\n        let count_post = 0;\r\n        let max_post = MAX_POST;\r\n\r\n        while (!is_final && count_post < max_post) {\r\n\r\n            let result = await rpa.control.evaluate(async (page_id, cursor) => {\r\n                try {\r\n\r\n                    var url = "https://" + window.location.hostname + "/api/graphql/";\r\n                    var spinR = require(["SiteData"]).__spin_r;\r\n                    var spinB = require(["SiteData"]).__spin_b;\r\n                    var spinT = require(["SiteData"]).__spin_t;\r\n                    var jazoest = require(["SprinkleConfig"]).jazoest;\r\n                    var fbdtsg = require(["DTSGInitData"]).token;\r\n                    var userId = require(["CurrentUserInitialData"]).USER_ID;\r\n                    var hsi = require(["SiteData"]).hsi;\r\n                    var variables = `{"afterTime":null,"beforeTime":null,"count":3,"cursor":"${cursor}","feedLocation":"TIMELINE","feedbackSource":0,"focusCommentID":null,"memorializedSplitTimeFilter":null,"omitPinnedPost":true,"postedBy":{"group":"OWNER"},"privacy":null,"privacySelectorRenderLocation":"COMET_STREAM","renderLocation":"timeline","scale":1,"stream_count":1,"taggedInOnly":null,"useDefaultActor":false,"id":"${page_id}","__relay_internal__pv__CometImmersivePhotoCanUserDisable3DMotionrelayprovider":false,"__relay_internal__pv__IsWorkUserrelayprovider":false,"__relay_internal__pv__IsMergQAPollsrelayprovider":false,"__relay_internal__pv__CometUFIReactionsEnableShortNamerelayprovider":false,"__relay_internal__pv__CometUFIShareActionMigrationrelayprovider":true,"__relay_internal__pv__CometIsAdaptiveUFIEnabledrelayprovider":false,"__relay_internal__pv__StoriesArmadilloReplyEnabledrelayprovider":false,"__relay_internal__pv__StoriesRingrelayprovider":false,"__relay_internal__pv__EventCometCardImage_prefetchEventImagerelayprovider":false}`\r\n                    var data = "av=" + userId + "&__user=" + userId + "&__a=1&__aaid=1&__dyn=&__csr=&__req=w&__hs=&dpr=1&__ccg=EXCELLENT&__rev=&__s=&__hsi=" + hsi + "&__comet_req=1&fb_dtsg=" + fbdtsg + "&jazoest=" + jazoest + "&lsd=&__spin_r=" + spinR + "&__spin_b=" + spinB + "&__spin_t=" + spinT + "&variables=" + encodeURIComponent(variables) + "&server_timestamps=true&doc_id=7826391930753397";\r\n\r\n                    var resPost = await fetch(url, {\r\n                        method: \'POST\',\r\n                        body: data,\r\n                        headers: {\r\n                            \'Content-Type\': \'application/x-www-form-urlencoded\'\r\n                        }\r\n                    }).then(function (response) { return response.text(); });\r\n\r\n                    return JSON.parse(resPost?.split(\'\\n\')[0]);\r\n                } catch (ex) {\r\n\r\n                }\r\n\r\n            }, PAGE_ID, cursor);\r\n\r\n            is_final = result?.extensions?.is_final;\r\n\r\n            for (let item of result?.data?.node?.timeline_list_feed_units?.edges) {\r\n                \r\n                let new_folder = `${PATH_DIR_IMAGE}/${item?.node?.post_id}`;\r\n                await createDirectory(new_folder);\r\n                for (let attachment of item?.node?.comet_sections?.content?.story?.attachments) {\r\n                    try {\r\n                        let randomNumberImage = getRandomNumber(10000, 99999);\r\n                        if (attachment?.styles?.attachment?.media?.__typename == "Photo") {\r\n                            const response = await axios.get(attachment?.styles?.attachment?.media?.photo_image?.uri, { responseType: \'arraybuffer\' });\r\n                            let path_image = `${new_folder}/${randomNumberImage}.jpg`;\r\n                            await writeFile(path_image, response.data);\r\n                        } else if (attachment?.styles?.attachment?.media?.__typename == "Video") {\r\n                            const response = await axios.get(attachment?.styles?.attachment?.media?.browser_native_hd_url, { responseType: \'arraybuffer\' });\r\n                            let path_video = `${new_folder}/${randomNumberImage}.mp4`;\r\n                            await writeFile(path_video, response.data);\r\n                        } else {\r\n\r\n                            for (let _attachment of attachment?.styles?.attachment?.all_subattachments?.nodes) {\r\n                                try {\r\n                                    let randomNumberImage = getRandomNumber(10000, 99999);\r\n                                    if (_attachment?.media?.__typename == "Photo") {\r\n                                        const response = await axios.get(_attachment?.media?.image?.uri, { responseType: \'arraybuffer\' });\r\n                                        let path_image = `${new_folder}/${randomNumberImage}.jpg`;\r\n                                        await writeFile(path_image, response.data);\r\n                                    } else if (_attachment?.styles?.attachment?.media?.__typename == "Video") {\r\n                                        const response = await axios.get(_attachment?.styles?.attachment?.media?.browser_native_hd_url, { responseType: \'arraybuffer\' });\r\n                                        let path_video = `${new_folder}/${randomNumberImage}.mp4`;\r\n                                        await writeFile(path_video, response.data);\r\n                                    } else {\r\n\r\n                                    }\r\n                                } catch (e) {\r\n\r\n                                }\r\n                            }\r\n\r\n                        }\r\n                    } catch (e) {\r\n\r\n                    }\r\n                }\r\n                let new_post = [{\r\n                    POST_ID: item?.node?.post_id || \'\',\r\n                    POST_URL: `https://www.facebook.com/${item?.node?.post_id}`,\r\n                    POST: item?.node?.comet_sections?.content?.story?.message?.text || "",\r\n                    ATTACHMENT: new_folder,\r\n                    CREATED_TIME: moment(item?.node?.comet_sections?.context_layout?.story.comet_sections?.metadata[0]?.story?.creation_time*1000).format(\'DD/MM/YYYY HH:mm:ss\') || \'\'\r\n                }];\r\n                count_post++;\r\n                cursor = item?.cursor;\r\n                await appendDataToGoogleSheet(PATH_JSON_SERVICE, ID_SHEET, new_post, `Post Page ${PAGE_ID}`);\r\n            }\r\n            await delay(getRandomNumber(min_time, max_time));\r\n        };\r\n\r\n        await rpa.control.close();\r\n        return;\r\n\r\n    } catch (ex) {\r\n        await rpa.control.close();\r\n        return;\r\n    }\r\n    function getRandomNumber(min, max) {\r\n        return Math.floor(Math.random() * (max - min + 1)) + min;\r\n    }\r\n};',
