      content:
        "async function startWorkflow() {\r\n    const rpa = new rpaLib.Rpa();\r\n    await rpa.connect($wsEndpoint);\r\n    // code here\r\n    try {\r\n        await rpa.gotoUrl(\"https://www.tiktok.com/\");\r\n\r\n        if (!(await rpa.checkExistElement('//a[@data-e2e=\"nav-foryou\"]'))) {\r\n            await rpa.control.close();\r\n            return;\r\n        };\r\n\r\n        await delay(getRandomNumber(5000, 10000));\r\n\r\n        await rpa.mouseClickXpath('//a[@data-e2e=\"nav-upload\"]');\r\n\r\n        await delay(getRandomNumber(5000, 10000));\r\n\r\n        try {\r\n\r\n            const inputHandle = await rpa.control.$('input[type=\"file\"]'); // Replace with the selector for the file input element\r\n\r\n            await delay(getRandomNumber(1000, 2000));\r\n\r\n            let array_image = await getAllFiles(PATH_DIR_VIDEO);\r\n\r\n            let mp4Files = array_image.filter(file => file.endsWith('.mp4'));\r\n\r\n            if (mp4Files.length == 0) {\r\n                await rpa.control.close();\r\n                return;\r\n            }\r\n\r\n            let video = mp4Files[getRandomNumber(0, mp4Files.length - 1)];\r\n\r\n            await inputHandle.uploadFile(video);\r\n\r\n            await delay(getRandomNumber(4000, 8000));\r\n\r\n            for (let i = 0; i < 10; i++) {\r\n                if (await rpa.checkExistElement('//div[@class=\"DraftEditor-editorContainer\"]')) {\r\n                    break;\r\n                } else {\r\n                    await delay(getRandomNumber(3000, 6000));\r\n                }\r\n            };\r\n\r\n            let content = await readFile(PATH_TXT);\r\n\r\n            await rpa.mouseClickXpath('//div[@class=\"DraftEditor-editorContainer\"]//span[@data-text=\"true\"]');\r\n            await delay(getRandomNumber(3000, 6000));\r\n\r\n            await rpa.control.keyboard.down('Control');  // Nhấn giữ phím Ctrl\r\n            await rpa.control.keyboard.press('A');       // Nhấn phím A (Ctrl + A)\r\n            await rpa.control.keyboard.up('Control');    // Nhả phím Ctrl\r\n\r\n            await delay(getRandomNumber(1000, 3000));\r\n\r\n            await rpa.control.keyboard.press('Backspace');  // Nhấn phím ESC\r\n\r\n            await delay(getRandomNumber(1000, 3000));\r\n\r\n            await rpa.keyboardType(content);\r\n\r\n            await delay(getRandomNumber(2000, 6000));\r\n\r\n            await rpa.getPointXpath('//button[@data-e2e=\"post_video_button\"]');\r\n            await rpa.scroll({ deltaX: 0, deltaY: 50 });\r\n            await delay(getRandomNumber(1000, 2000));\r\n            await rpa.mouseClickXpath('//button[@data-e2e=\"post_video_button\"]');\r\n\r\n            for (let i = 0; i < 10; i++) {\r\n                if (await rpa.checkExistElement('//button[@data-e2e=\"post_video_button\"]')) {\r\n                    await delay(getRandomNumber(1000, 3000));\r\n                } else {\r\n                    break;\r\n                }\r\n            };\r\n\r\n            await delay(getRandomNumber(2000, 5000));\r\n\r\n            await rpa.control.close();\r\n            return;\r\n        } catch (e) {\r\n        }\r\n\r\n        // await rpa.control.close();\r\n        // return;\r\n    } catch (e) {\r\n        await rpa.control.close();\r\n        return;\r\n    }\r\n    function getRandomNumber(min, max) {\r\n        return Math.floor(Math.random() * (max - min + 1)) + min;\r\n    }\r\n};",
