      readme:
        '<h4>HƯỚNG DẪN SỬ DỤNG</h4><ul><li>Đăng nhập sẵn tài khoản tiktok vào hồ sơ.</li><li>Điền đầy đủ các thông số vào trong đầu vào.</li><li>Tạo nhiệm vụ.</li><li>Chạy nhiệm vụ.</li></ul>',
