      content:
        // eslint-disable-next-line no-template-curly-in-string
        "async function startWorkflow() {\r\n    const rpa = new rpaLib.Rpa();\r\n    await rpa.connect($wsEndpoint);\r\n    // code here\r\n    try {\r\n        await rpa.gotoUrl(`https://www.tiktok.com/@${USERNAME}?lang=en`);\r\n\r\n        await delay(getRandomNumber(5000, 10000));\r\n\r\n        if (await rpa.checkExistElement('//*[@id=\"login-modal-title\"]')) {\r\n            console.log(\"Tài khoản chưa được đăng nhập\");\r\n            await rpa.control.close();\r\n            return;\r\n        };\r\n\r\n        await rpa.control.keyboard.press('Space');\r\n        await delay(getRandomNumber(5000, 10000));\r\n\r\n        if (await rpa.checkExistElement('//div[@aria-label=\"Watch in full screen\"]//a')) {\r\n            await rpa.tryExecuteJS(`document.evaluate('//div[@aria-label=\"Watch in full screen\"]//a', document, null, XPathResult.FIRST_ORDERED_NODE_TYPE, null).singleNodeValue.click();`)\r\n            await delay(getRandomNumber(5000, 10000));\r\n        }\r\n        let max_video = MAX_VIDEO;\r\n        let min_time = WATCH_TIME_MIN.min * 1000;\r\n        let max_time = WATCH_TIME_MAX.max * 1000;\r\n\r\n        for (let i = 0; i < max_video; i++) {\r\n\r\n            await delay(getRandomNumber(3000, 10000));\r\n\r\n            if (IS_LIKE && getRandomNumber(0, 100) > 70) {\r\n                await rpa.control.keyboard.press('L');\r\n                await delay(getRandomNumber(3000, 8000));\r\n            };\r\n\r\n            if (IS_ADD_FAVORITE && getRandomNumber(0, 100) > 70) {\r\n                await rpa.mouseClickXpath('//button[contains(@aria-label,\"Add to Favorites\")]');\r\n                await delay(getRandomNumber(3000, 8000));\r\n            }\r\n\r\n            await delay(getRandomNumber(min_time, max_time));\r\n\r\n            await rpa.control.keyboard.press('ArrowDown');\r\n\r\n        };\r\n        await delay(getRandomNumber(3000, 8000));\r\n        await rpa.control.close();\r\n        return;\r\n    } catch (e) {\r\n        await rpa.control.close();\r\n        return;\r\n    }\r\n    function getRandomNumber(min, max) {\r\n        return Math.floor(Math.random() * (max - min + 1)) + min;\r\n    }\r\n};",
