        'Quy trình này là một công cụ tiên tiến, được thiết kế để hỗ trợ cá nhân và doanh nghiệp  thu thập thông tin các địa điểm dựa trên từ khóa và vị trí trên Google Maps một cách hiệu quả và chính xác.',
      readme: '<h4>HƯỚNG DẪN SỬ DỤNG</h4>',
