      content:
        // eslint-disable-next-line no-template-curly-in-string
        'async function startWorkflow() {\r\n    const rpa = new rpaLib.Rpa();\r\n    await rpa.connect($wsEndpoint);\r\n    // code here\r\n    try {\r\n        await rpa.gotoUrl(\'https://www.google.com/maps\');\r\n\r\n        await delay(getRandomNumber(1000, 5000));\r\n\r\n        if (LOCATION) {\r\n\r\n            await rpa.control.$eval(\'input[name="q"\', el => el.value = \'\');\r\n\r\n            await rpa.keyboardTypeXpath(\'//input[@name="q"]\', `Vị trí ${LOCATION}`);\r\n\r\n            await delay(getRandomNumber(1000, 2000));\r\n\r\n            await rpa.control.keyboard.press(\'Enter\');\r\n\r\n            await delay(getRandomNumber(5000, 10000));\r\n\r\n        }\r\n        if (KEYWORD) {\r\n\r\n            await rpa.control.$eval(\'input[name="q"\', el => el.value = \'\');\r\n\r\n            await rpa.keyboardTypeXpath(\'//input[@name="q"]\', KEYWORD);\r\n\r\n            await delay(getRandomNumber(1000, 2000));\r\n\r\n            await rpa.control.keyboard.press(\'Enter\');\r\n\r\n            await delay(getRandomNumber(5000, 10000));\r\n\r\n        }\r\n\r\n        let list_results = [];\r\n\r\n        // await rpa.mouseClickXpath(\'//a[@aria-label!="" and contains(@href,"https://www.google.com/maps")]\');\r\n        await rpa.mouseMove(50,300);\r\n\r\n        await delay(2000);\r\n\r\n        let count = 0;\r\n        let count_location =0; ;\r\n\r\n        while (count != 3) {\r\n            let element_lists = await rpa.control.$x(\'//a[@aria-label!="" and contains(@href,"https://www.google.com/maps")]\');\r\n            await rpa.control.mouse.wheel({ deltaY: 1500 }); // Cuộn xuống 500px\r\n            await delay(getRandomNumber(2000, 10000));\r\n            let new_element_lists = await rpa.control.$x(\'//a[@aria-label!="" and contains(@href,"https://www.google.com/maps")]\');\r\n            if (element_lists?.length == new_element_lists?.length) {\r\n                count++;\r\n            };\r\n            count_location = new_element_lists?.length;\r\n\r\n            if(count_location >= COUNT_LOCATION_MAX ){\r\n                break;\r\n            }\r\n        };\r\n\r\n        let element_lists = await rpa.control.$x(\'//a[@aria-label!="" and contains(@href,"https://www.google.com/maps")]\');\r\n\r\n        for (let element of element_lists) {\r\n            let url = await element.evaluate(el => el.getAttribute(\'href\'));\r\n\r\n            let result = {};\r\n\r\n            let data = await makeHTTPRequest(url, { method: \'GET\' });\r\n\r\n            let regex_phone = /(?<=tel:)(\\+?\\d{1,4}[\\s.-]?\\d{2,3}[\\s.-]?\\d{3,4}[\\s.-]?\\d{3,4})/;\r\n            let match_phone = data?.match(regex_phone);\r\n            if (match_phone) {\r\n                result.PHONE = match_phone[1] || "";\r\n            }\r\n\r\n            let regex_content = /<meta\\s+content="([^"]+)" itemprop="name"/;\r\n            let match_content = data?.match(regex_content);\r\n            if (match_content) {\r\n                result.NAME = match_content[1]?.split(\'·\')[0] || "";\r\n                result.ADDRESS = match_content[1]?.split(\'·\')[1] || ""\r\n            }\r\n\r\n            let regex_star = /<meta\\s+content="([^"]+)" property="og:description"/;\r\n            let match_star = data?.match(regex_star);\r\n            if (match_star) {\r\n                result.STAR = match_star[1]\r\n            };\r\n            // result.URL = url;\r\n            list_results?.push(result)\r\n        };\r\n        await appendDataToGoogleSheet(PATH_JSON_SERVICE, ID_SHEET, list_results, KEYWORD);\r\n        await rpa.control.close();\r\n        return;\r\n    } catch (e) {\r\n        await rpa.control.close();\r\n        return;\r\n    }\r\n\r\n};',
